import React, {Component} from 'react'
import {Link, BrowserRouter as Route} from 'react-router-dom'

class Navbar extends Component{
    state = {
        isLoggedIn: false,
        currentPath: "",
        isActiveUrl : {
            home : false,
            register: false,
            login: false,
            products: false,
            news: false
        }
    }
    handleClick = (e) => {
        this.setState({
            currentPath : e.target.href
        })
    }
    onActive = () => {
        console.log(this.state.currentPath)
        return this.props.setActivePath("http://localhost:3000/register", this.state.currentPath);
    }
    render(){
        return(
            <div className="App">
                    <hr/>
                        <h2 style={navTextStyling}>News Products Login <Route path="/register"><Link style={this.onActive()} onClick={this.handleClick} className="registerLink" to="/register">Register</Link></Route></h2>
                    <hr/>            
            </div>
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}

export default Navbar;
